.nav-container {
    box-shadow: 0 .09rem .3rem 0 $darkBlue;
    background: $white;
    position: relative;
    z-index: 1;

    nav {
        ul {
            width: 100%;

            .button-and-nav-links-container {
                @media (min-width:1000px) {
                    width: 70%;

                    .wrapper {
                        overflow: visible;

                        .nav-items-container {
                            position: relative;
                            top: .3rem;
                            width: 50%;
                        }
                    }
                    .button-group{
                        .button-container{
                            button{
                                padding:.7rem 2.2rem;
                                font-size:1.2rem;
                            }
                        }
                    }
                }

                @media (max-width:999px) {
                    top: 4.7rem;
                    right: 0rem;
                    display: block;
                    width: 30%;
                    position: absolute;
                    overflow-x: hidden;
                    height: calc(100vh - 5rem);
                    z-index: 1;
                    @media (max-width:500px) {
                        width: 100%;
                    }
                    @media (min-width:500px){
                        top:5.3rem;
                        height:calc(100vh - 5.6rem);
                    }
                    @media (min-width:700px) {
                        top: 5.45rem;
                        height: calc(100vh - 5.5rem);
                    }

                    @media (min-width:501px) and (max-width:800px) {
                        width: 50%;
                    }

                    @media (min-width:801px) {
                        width: 40%;
                    }

                    .wrapper {
                        transform: translateX(100%);
                        transition: transform .2s ease-in-out;
                        background: white;
                        height: 100%;
                        display: flex;
                        flex-direction: column;
                        justify-content: space-between;
                    }

                    &[aria-hidden="false"] {
                        .wrapper {
                            transform: translateX(0);
                            visibility: visible;
                            opacity: 1;
                        }
                    }

                    .nav-items-container {
                        width: 100%;

                        .nav-items {
                            display: block;

                            li {
                                padding: .8rem 1rem;
                                box-shadow: inset 0 0 .1rem 0 $darkBlue;
                                border-bottom: none;
                                margin: 0;
                            }
                        }
                    }

                    .button-group {
                        justify-content: space-between;
                        flex-direction: column;
                        padding: .2rem 0;
                        width: 100%;

                        .button-container {
                            width: calc(100% - 4px);
                            padding: 0;
                            margin: .1rem 0;
                            border-radius: 1rem;

                            &:last-child {
                                margin-bottom: 1rem;
                            }

                            button {
                                width: 100%;
                            }
                        }
                    }
                }
            }
        }
    }
}

